import styles from '../navbar/navbar.module.scss';

export default class Navbar extends Component {
  render() {
    return(
      <nav className={styles.nav}>
        <a className={styles.brand} href=""><img className={styles.logo} src="" alt="" />LOGO</a>
      </nav>
    );
  }
}
